import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Page1 from './components/page/Page1';
import Page2 from './components/page/Page2';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="one" element={<Page1 />} />
        <Route path="two" element={<Page2 />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;











